import { Box, CircularProgress, withStyles } from "@material-ui/core";
import useQuizTest from "./useQuizTest";

interface IProps {
  quizId: number;
}

export default function QuizTest({ quizId }: IProps) {
  const { testStatus, isLoading } = useQuizTest(quizId);

  return (
    <Container>
      {isLoading && <CircularProgress />}
      {testStatus}
    </Container>
  );
}

const Container = withStyles({
  root: {
    display: "flex",
    width: "100vw",
    minHeight: "calc(100vh - 100px)",
    flexDirection: "column",
    alignItems: "center",
    padding: "2rem 1rem",
    backgroundColor: "#f0f2f5",
  },
})(Box);
